  return (
    <div className='contaner'>
      <span className='text'>We TRAIN and, build relationships with upcoming developers be a part of our community of developers.</span>
      <br />
      <div className='b'>
        <button className='btn' onClick={() => navigate("/Dop")}>WHY DOP@E?!</button>
        <button className='' onClick={() => navigate("/Form")}>APPLY NOW!</button>
      </div>
    
    </div>
  );
};
 
export default Landing;
